CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_categories_and_undercategories_by_administratoruser` ()  BEGIN

Select 
user.UserFirstName,
user.UserEmail,
categories.CategoriesID,
categories.CategoriesName,
categories.VisibleCategory,
undercategories.UnderCategoriesID,
undercategories.UnderCategoriesName,
undercategories.VisibleUndercategory

FROM (((user
INNER JOIN administratoruser ON user.UserID = administratoruser.user_UserID)
INNER JOIN categories ON administratoruser_AdministratorUserID = administratoruser.AdministratorUserID)
INNER JOIN undercategories ON categories_CategoriesID = categories.CategoriesID);
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_contributors_products_with_categories` ()  BEGIN
Select 
user.UserFirstName, 
user.UserLastName, 
product.ProductID,
product.name,
undercategories.UnderCategoriesName,
categories.CategoriesName,
photoupload_PhotoUploadID


FROM (((((user
INNER JOIN contributoruser ON user.UserID = contributoruser.User_UserID)
INNER JOIN product ON contributoruser_ContributorUserID = contributoruser.ContributorUserID)
INNER JOIN categoryproductlines ON product_ProductID = product.ProductID)
INNER JOIN undercategories ON UnderCategoriesID = categoryproductlines.undercategories_UnderCategoriesID)
INNER JOIN categories ON CategoriesID = undercategories.categories_CategoriesID);

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_info_about_contributors` ()  BEGIN
Select 
user.UserFirstName, 
user.UserLastName, 
user.UserEmail,
country.CountryPhonecode,
user.UserPhoneNo,
useraddress.UserAddress,
useraddress.UserCity,
useraddress.UserPostNo,
country.CountryNicename

from (((user
INNER JOIN contributoruser ON user.UserID = contributoruser.User_UserID)
INNER JOIN useraddress ON useraddress.user_UserID = contributoruser.user_UserID)
INNER JOIN country ON CountryID = useraddress.country_CountryID);

END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_info_about_products` (IN `ProductName` VARCHAR(50))  BEGIN
Select
product.Name,
user.UserFirstName as "Created by",
max(Steps.ProductStepNo) as "Total steps to complete",
avg(rateproduct.RateProductAction) as "avg rating",
COUNT(DISTINCT favouriteproduct.FavouriteProductID) as "Total favourites",
count(DISTINCT productcomments.ProductCommentID) AS "Total comments"


FROM ((((((product 
INNER JOIN contributoruser ON contributoruser.ContributorUserID = product.contributoruser_ContributorUserID)
INNER JOIN user ON user.UserID = contributoruser.user_UserID)
LEFT JOIN rateproduct ON rateproduct.product_ProductID = product.ProductID)
LEFT JOIN productcomments ON productcomments.product_ProductID = product.ProductID)
LEFT JOIN steps ON steps.product_ProductID = product.ProductID)
LEFT JOIN favouriteproduct ON favouriteproduct.product_ProductID = product.ProductID)
WHERE product.name = ProductName
GROUP by product.name;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_insert_user_info` (IN `UserEmail` VARCHAR(50), IN `UserPassword` VARCHAR(255), IN `UserFirstName` VARCHAR(50), IN `UserLastName` VARCHAR(50), IN `UserPhoneNo` VARCHAR(30), OUT `user_id` BIGINT(50), IN `Postnr` VARCHAR(50), IN `city` VARCHAR(50), IN `Country` VARCHAR(50), IN `Address` VARCHAR(50), OUT `contributoruser_id` BIGINT(50))  BEGIN
	DECLARE country_ID int(11);
   
    INSERT INTO `ikea_hacks_db`.`user` (`UserEmail`, `UserPassword`, `UserFirstName`, `UserLastName`, `UserPhoneNo`, `UserID`)
    VALUES (UserEmail, UserPassword, UserFirstName, UserLastName, UserPhoneNo, user_id); -- add user into userlist

    -- If we inserted a row, get the new ID
    if (Select ROW_COUNT() = 1) then 
	set user_id = LAST_INSERT_ID(); 
    -- set @s = user_id; -- debugging

	Select CountryID from country where country.CountryNicename = Country into country_ID;
    -- set @s = country_ID; -- debugging
    
    INSERT INTO `ikea_hacks_db`.`useraddress` (`UserPostNo`, `UserCity`, `country_CountryID`, `user_UserID`, `UserAddress`) 
    VALUES (Postnr, city, country_ID, user_id, Address); -- insert user address
    
    INSERT INTO `ikea_hacks_db`.`contributoruser` (`user_UserID`) 
    VALUES (user_id); -- add user to contributoruser list
    
    -- get the new ID for contributoruser_id
    set contributoruser_id = LAST_INSERT_ID(); 
    -- set @s = contributoruser_id; -- debugging
	
    INSERT INTO `ikea_hacks_db`.`usertierslines` (`contributoruser_ContributorUserID`)
	VALUES (contributoruser_id); -- set contributoruser to beginner tier
    
    end if;
    
    Select @s; -- for debugging
	PREPARE stmt FROM @s;
    EXECUTE stmt;
    DEALLOCATE PREPARE stmt;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_search_product_name` (IN `ProductName` VARCHAR(50))  BEGIN
Select
product.Name,
user.UserFirstName as "Created by",
max(Steps.ProductStepNo) as "Total steps to complete",
avg(rateproduct.RateProductAction) as "avg rating",
COUNT(DISTINCT favouriteproduct.FavouriteProductID) as "Total favourites",
count(DISTINCT productcomments.ProductCommentID) AS "Total comments"


FROM ((((((product 
INNER JOIN contributoruser ON contributoruser.ContributorUserID = product.contributoruser_ContributorUserID)
INNER JOIN user ON user.UserID = contributoruser.user_UserID)
LEFT JOIN rateproduct ON rateproduct.product_ProductID = product.ProductID)
LEFT JOIN productcomments ON productcomments.product_ProductID = product.ProductID)
LEFT JOIN steps ON steps.product_ProductID = product.ProductID)
LEFT JOIN favouriteproduct ON favouriteproduct.product_ProductID = product.ProductID)
WHERE product.name = ProductName
GROUP by product.name;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_sum_of_qty_by_categories` ()  BEGIN
Select 
categories.CategoriesID,
categories.CategoriesName,
undercategories.UnderCategoriesName,
Count(product.ProductID) as "Qty of products by Category"

FROM (((product 
INNER JOIN categoryproductlines ON categoryproductlines.product_ProductID = product.ProductID)
INNER JOIN undercategories ON UnderCategoriesID = categoryproductlines.undercategories_UnderCategoriesID)
INNER JOIN categories ON CategoriesID = undercategories.categories_CategoriesID)
Group by undercategories.UnderCategoriesName
Order by categories.CategoriesID ASC;
END$$

